CREATE DEFINER=`root`@`localhost` PROCEDURE `newEntriesFilter`(
category varchar(100), 
location varchar(100),
search varchar(100))
BEGIN
select c.* FROM card c join card_details cd on cd.card_detail_id = c.card_detail_id 
 where cd.publish = 1 and TIMESTAMPDIFF(DAY,c.create_date,CURDATE()) <= (7)
 and (category is null or cd.category = category) and (location is null or c.location_id = location  ) 
 and (search is null or c.description like concat(concat('%',search),'%') or c.header like concat(concat('%',search),'%') or cd.price like search or cd.dealtype like concat(concat('%',search),'%') or cd.street like concat(concat('%',search),'%') or cd.type like concat(concat('%',search),'%')) 
 order by c.create_date DESC;
END ;;
